<h2>网络架构</h2>
<figure><figcaption>image-20220315131603410</figcaption></figure>
<p>网络受到 GoogLeNet 启发来搭建的，其中包括 24 个卷积层和 2 个全连接层，但是作者没有使用 Inception 块，而是使用数个 1x1 和 3x3 的卷积层堆砌而成。</p>
